import React, {useContext} from "react";
import Modal from "@mui/material/Modal";
import {
    Backdrop,
    Box,
    Button, CircularProgress,
    Divider,
    Grid, IconButton, InputAdornment,
    MenuItem,
    Stack,
    TextField,
    Typography
} from "@mui/material";
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import useMediaQuery from "@mui/material/useMediaQuery";
import {useTheme} from "@mui/material/styles";
import UserContext from "../../hooks/user/UserContext";

const scrollBarStyle = {
    scrollbarWidth: 'thin', // Para navegadores que no sean webkit
    scrollbarColor: '#888 #f1f1f1', // Color del pulgar y del riel
    WebkitOverflowScrolling: 'touch',
    '&::-webkit-scrollbar': {
        width: '10px',
    },
    '&::-webkit-scrollbar-thumb': {
        background: '#888',
        borderRadius: '12px',
    },
    '&::-webkit-scrollbar-thumb:hover': {
        background: '#555',
    },
}

export default function UserForm() {

    const {
        User,
        openForm,
        handleInputChange,
        handleOnBlur,
        handleCloseForm,
        handleSubmit,
        UserError,
        edit,
        showPassword,
        handleTogglePassword,
        isLoading} = useContext(UserContext);

    const theme = useTheme()
    const isSmallScreen = useMediaQuery(theme.breakpoints.down('sm'));

    const modalStyle = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: isSmallScreen ? '90%' : '70%',
        height: isSmallScreen ? '80%' : '74%',
        overflowY: 'auto',
        bgcolor: 'background.paper',
        boxShadow: 24,
        p: 4,
        borderRadius: 2,

        ...(isSmallScreen ? {} : {scrollBarStyle}),
    };

    const textFieldStyle = { minHeight: "5rem" };

    return (
        <>
            <Modal
                open={openForm}
                onClose={handleCloseForm}
                aria-labelledby="modal-modal-title"
                aria-describedby="modal-modal-description"
            >
                <Box
                    component="form"
                    sx={modalStyle}
                    noValidate
                    autoComplete="off"
                    onSubmit={handleSubmit}
                >
                    <Stack direction="row" alignItems="center" justifyContent="space-between" mb={2}>
                        <Typography variant="h4" gutterBottom>
                            {edit ? "Editar" : "Crear"} Cliente
                        </Typography>
                    </Stack>
                    <Grid container spacing={3}>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"primerNombre"}
                                error={UserError.primerNombre !== ""}
                                fullWidth
                                required
                                name="primerNombre"
                                value={User.primerNombre}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label= {t("clientes.label.primerNombre")} variant="outlined"
                                helperText={t(UserError.primerNombre,  {maximo: '50', minimo: '2'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"segundoNombre"}
                                error={UserError.segundoNombre !== ''}
                                fullWidth
                                name="segundoNombre"
                                value={User.segundoNombre}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.segundoNombre")} variant="outlined"
                                helperText={t(UserError.segundoNombre,  {maximo: '50', minimo: '2'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"primerApellido"}
                                error={UserError.primerApellido !== ''}
                                fullWidth
                                required
                                name={"primerApellido"}
                                value={User.primerApellido}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.primerApellido")} variant="outlined"
                                helperText={t(UserError.primerApellido,  {maximo: '50', minimo: '2'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"segundoApellido"}
                                error={UserError.segundoApellido !== ''}
                                fullWidth
                                name={"segundoApellido"}
                                value={User.segundoApellido}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.segundoApellido")} variant="outlined"
                                helperText={t(UserError.segundoApellido,  {maximo: '50', minimo: '2'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"cedula"}
                                error={UserError.cedula !== ''}
                                fullWidth
                                required
                                name={"cedula"}
                                value={User.cedula}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.cedula")} variant="outlined"
                                helperText={t(UserError.cedula,  {minimo: '8', maximo: '10'})}
                                style={textFieldStyle}
                                disabled={edit}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"telefono"}
                                error={UserError.telefono !== ''}
                                fullWidth
                                required
                                name={"telefono"}
                                value={User.telefono}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.telefono")} variant="outlined"
                                helperText={t(UserError.telefono, {minimo: '7', maximo: '10'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"celular"}
                                error={UserError.celular !== ''}
                                fullWidth
                                required
                                name={"celular"}
                                value={User.celular}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.celular")} variant="outlined"
                                helperText={t(UserError.celular, {exacto: '10'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"ciudad"}
                                error={UserError.ciudad !== ''}
                                fullWidth
                                required
                                name={"ciudad"}
                                value={User.ciudad}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.ciudad")} variant="outlined"
                                helperText={t(UserError.ciudad, {maximo: '50'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"direccion"}
                                error={UserError.direccion !== ''}
                                fullWidth
                                required
                                name={"direccion"}
                                value={User.direccion}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.direccion")} variant="outlined"
                                helperText={t(UserError.direccion,  {maximo: '50', minimo: '5'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"fechaNacimiento"}
                                error={UserError.fechaNacimiento !== ''}
                                InputLabelProps={{ shrink: true }}
                                fullWidth
                                type={"date"}
                                required
                                name={"fechaNacimiento"}
                                value={User.fechaNacimiento}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.fechaNacimiento")} variant="outlined"
                                helperText={t(UserError.fechaNacimiento)}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={3}>
                            <TextField
                                id={"genero"}
                                error={UserError.genero !== ''}
                                select
                                fullWidth
                                required
                                name={"genero"}
                                value={User.genero}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.genero")} variant="outlined"
                                helperText={t(UserError.genero)}
                                style={textFieldStyle}
                            >
                                {genders.map((option) => (
                                    <MenuItem id={option.id} key={option.id} value={option.label}>
                                        {t(`generos.${option.label}`)}
                                    </MenuItem>
                                ))}
                            </TextField>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"correo"}
                                error={UserError.correo !== ''}
                                fullWidth
                                required
                                name={"correo"}
                                value={User.correo}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.correo")} variant="outlined"
                                helperText={t(UserError.correo,  {maximo: '320', minimo: '6'})}
                                style={textFieldStyle}
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                id={"clave"}
                                type={showPassword ? 'text' : 'password'}
                                error={UserError.clave !== ''}
                                fullWidth
                                required
                                name={"clave"}
                                value={User.clave}
                                onChange={handleInputChange}
                                onBlur={handleOnBlur}
                                label={t("clientes.label.contraseña")} variant="outlined"
                                helperText={t(UserError.clave,  {maximo: '50', minimo: '8'})}
                                style={textFieldStyle}
                                onCopy={(e) => {
                                    e.preventDefault();
                                }}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton onClick={handleTogglePassword} edge="end">
                                                {showPassword ? <VisibilityIcon /> : <VisibilityOffIcon />}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        </Grid>
                    </Grid>
                    <Divider sx={{ my: 2 }} />
                    <Stack direction="row" alignItems="center" justifyContent="space-between" >
                        <Button id={"agregar-editar-cliente"} variant="contained" type="submit">
                            {t(`general.botones.${edit? "editar" : "agregar"}`)}
                        </Button>
                        <Button variant="contained" onClick={handleCloseForm}>
                            {t("general.botones.cancelar")}
                        </Button>
                    </Stack>
                </Box>
            </Modal>
            <Backdrop
                sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 5000, position: 'absolute'}}
                open = {isLoading}
            >
                <CircularProgress color="inherit" />
            </Backdrop>
        </>
    );
}
